function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route element={<Layout />}>
            <Route path='/' element= {<Sidebar />} />
          </Route>
        </Routes>
      </BrowserRouter>
      
    </>
  );
}

export default App;
